import VideoTitle from './VideoTitle'
import VideoBackground from './VideoBackground'
import { useSelector } from 'react-redux';

const MainContainer = () => {
    const movie = useSelector(store => store.movie?.nowPlayingMovies);

    return (
        <div>
            <VideoTitle />
            <VideoBackground />
        </div>
    )
}

export default MainContainer
